package ir.composeopeqe.dataimport android.os.Parcelableimport androidx.room.Entityimport androidx.room.PrimaryKeyimport com.google.gson.annotations.SerializedNameimport kotlinx.android.parcel.Parcelize@Parcelizedata class Users(    val results: List<Result>,    @SerializedName("info") val info: Info) : Parcelable@Entity(tableName = "Users")@Parcelizedata class Result(    @PrimaryKey(autoGenerate = true) var idd : Long,    @SerializedName("gender") val gender: String,    val name: Name,    val location: Location,    @SerializedName("email") val email: String,    val login: Login,    val dob: Dob,    val registered: Registered,    @SerializedName("phone") val phone: String,    @SerializedName("cell") val cell: String,    val id: Id,    val picture: Picture,    @SerializedName("nat") val nat: String    ) : Parcelable@Parcelizedata class Dob(    @SerializedName("age") val age: Int,    @SerializedName("date") val date: String): Parcelable@Parcelizedata class Id(    @SerializedName("name") val name: String,    @SerializedName("value") val value: String): Parcelable@Parcelizedata class Location(    val street: Street,    @SerializedName("city") val city: String,    @SerializedName("state") val state: String,    @SerializedName("postcode") val postCode: String,    val coordinates: Coordinates,    val timezone: Timezone): Parcelable@Parcelizedata class Street(    @SerializedName("number") val number : Int ,    @SerializedName("name") val name : String): Parcelable@Parcelizedata class Login(    @SerializedName("md5") val md5: String,    @SerializedName("password") val password: String,    @SerializedName("salt") val salt: String,    @SerializedName("sha1") val sha1: String,    @SerializedName("sha256") val sha256: String,    @SerializedName("username") val username: String,    @SerializedName("uuid") val uuid: String): Parcelable@Parcelizedata class Name(    @SerializedName("first") val first: String,    @SerializedName("last") val last: String,    @SerializedName("title") val title: String ,): Parcelable@Parcelizedata class Picture(    @SerializedName("large") val large: String,    @SerializedName("medium") val medium: String,    @SerializedName("thumbnail") val thumbnail: String): Parcelable@Parcelizedata class Registered(    @SerializedName("age") val age: Int,    @SerializedName("date") val date: String): Parcelable@Parcelizedata class Coordinates(    @SerializedName("latitude") val latitude: String,    @SerializedName("longitude") val longitude: String): Parcelable@Parcelizedata class Timezone(    @SerializedName("description") val description: String,    @SerializedName("offset") val offset: String): Parcelable@Parcelizedata class Info(    @SerializedName("seed") val seed : String ,    @SerializedName("results") val results : Int ,    @SerializedName("page") val page : Int ,    @SerializedName("version") val version : String): Parcelable